import React, { useContext, useEffect } from 'react'
import TypeTable from '../dataTable/ProductTypeTable'
import Data from '../../../client/ProductType/data/ProductTypeData'
import ProductTypeAdd from '../components/ProductTypeAdd'
const ProductTypeContent = () => {

    useEffect(() => {
        console.log("turuulj duudagdlaa");
        getData('./datas.json', (err, type) => {
            if (err) {
                console.log(err)
                return
            }
            console.log("data" + type.name);
        })
    }, []);
    return (
        <div className="content-wrapper">
            <div>
                <div className="content-header">
                    <div className="container-fluid">
                        <div className="row">
                            <div className="col-6">
                                <ProductTypeAdd></ProductTypeAdd>
                            </div>
                        </div>
                    </div>
                </div>

                <section className="content">
                    <div className="container-fluid">
                        <div className="row">
                            <div className="col-12"><TypeTable></TypeTable></div>
                        </div>
                    </div>
                </section>
            </div>
        </div>
    )
}

export default ProductTypeContent;
